import React from 'react';
import { Grid } from '@material-ui/core';
import Layout from '../../components/Layout/Layout';

const Home = ({
    params,
}) => (
  <Grid style={{ flexGrow: 1 }} container justify="center" alignItems="center">
      <h1>{params}</h1>
  </Grid>
);

export default Home;
